import React from 'react';
import { Link } from 'react-router-dom';
import { Navbar, Nav } from 'react-bootstrap';
import { SHOP_NAME } from '../constant';

export default class Navigation extends React.Component {

    render() {
        return <Navbar bg="light" expand="lg">
            <Navbar.Brand href="/">
                <img
                    src="/asset/image/logo.png"
                    width="30"
                    height="30"
                    className="d-inline-block align-top"
                    alt={SHOP_NAME}
                />
            </Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="mr-auto" >
                    <Nav.Link tag={Link} eventKey={1} href="/">main</Nav.Link>
                    <Nav.Link tag={Link} eventKey={2} href="/second">second</Nav.Link>
                    {/* <LinkContainer to="/">
                        <NavItem eventKey={1}>main</NavItem>
                    </LinkContainer> */}
                    {/* <LinkContainer to="/second">
                        <NavItem eventKey={2}>second</NavItem>
                    </LinkContainer>  */}
                </Nav>
            </Navbar.Collapse>
        </Navbar>
    }

}
